    render() {
        return (
            <div className="App">
                <header className="App-header">
                    <div className="logo-container">
                        <img src={require('../../../chat-application/frontend/src/assets/guild.png')} className='guild-image'></img>
                    </div>
                    <div>
                        <h1 className="App-title">BOO BOO APPLICATION</h1>
                    </div>
                </header>
                <ChatAppController/>
            </div>
        )
    }
}
